import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';
import './AddChildPage.css';

const AddChildPage = () => {
    const history = useHistory();
    const [formData, setFormData] = useState({ firstName: '', lastName: '', birthDate: '', height: '', weight: '', bloodType: 'A+' });

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('Form Data Submitted:', formData);
        alert('کودک با موفقیت اضافه شد (به صورت موقت).');
        history.push('/my-children');
    };

    return (
        <div className="add-child-page">
            <nav className="page-nav-final">
                <h1>افزودن کودک جدید</h1>
                <button onClick={() => history.push('/my-children')} className="back-btn-add-child">&rarr;</button>
            </nav>
            <div className="add-child-form-container">
                <form onSubmit={handleSubmit} className="add-child-form">
                    <div className="form-row">
                        <div className="form-group"><label>نام</label><input name="firstName" onChange={handleChange} required /></div>
                        <div className="form-group"><label>نام خانوادگی</label><input name="lastName" onChange={handleChange} required /></div>
                    </div>
                    <div className="form-row">
                        <div className="form-group"><label>تاریخ تولد</label><input name="birthDate" placeholder="مثال: ۱۳۸۵/۰۵/۱۴" onChange={handleChange} required /></div>
                        <div className="form-group"><label>گروه خونی</label><select name="bloodType" onChange={handleChange}><option>A+</option><option>A-</option><option>B+</option><option>B-</option><option>AB+</option><option>AB-</option><option>O+</option><option>O-</option></select></div>
                    </div>
                    <div className="form-row">
                        <div className="form-group"><label>قد (سانتی‌متر)</label><input type="number" name="height" onChange={handleChange} /></div>
                        <div className="form-group"><label>وزن (کیلوگرم)</label><input type="number" step="0.1" name="weight" onChange={handleChange} /></div>
                    </div>
                    <div className="form-group-full"><label>سابقه بیماری</label><textarea name="medicalHistory" rows="4" onChange={handleChange}></textarea></div>
                    <div className="form-group-full"><label>توضیحات</label><textarea name="notes" rows="4" onChange={handleChange}></textarea></div>
                    <div className="form-actions">
                        <button type="submit" className="btn-save">ذخیره</button>
                        <button type="button" onClick={() => history.push('/my-children')} className="btn-cancel">انصراف</button>
                    </div>
                </form>
            </div>
        </div>
    );
};

export default AddChildPage;
